function _each(baseEl, selector, cb) {
  if (!baseEl) {
    return;
  }
  var els = baseEl.querySelectorAll(selector);
  if (!els) {
    return;
  }

  for (var i = 0; i < els.length; i++) {
    cb(i, els[i]);
  }
}

